inalisinvestigationecdossos\n\nColecionador de ossos é um canal de \"True Crime\" (que significa crimes reais). Apresentado por Bryan Emmendörfer, os vídeos contam casos criminais que ocorrem em todo o mundo, desde casos criminais norte americanos, brasileiros ou até mesmo de países pouco conhecidos. \n\nO mundo do True Crime já era muito desbravado por canais como Freak TV, Jaqueline Guerreiro, Ler até amanhecer entre outros. E nós chegamos para somar! Acreditamos que quanto mais canais falando sobre o mundo criminal, melhor é todos, pois o publico aumenta consequentemente.\n\nNossos vídeos abordam desaparecimentos, serial killers (assassinos em série). Nós produzimos os vídeos em um estilo documentário criminal (documentários criminais) como se fosse digamos assim, um documentário criminal dublado, algo importado de documentários internacionais de crimes reais.\n\nJá produzimos grandes casos aqui no canal, como Jeffrey Dahmer, Albert Fish, Richard Ramirez, Joe Metheny, Billy Milligan, Caso Araceli, Unabomber, Irmãos Bever, Passo Dyatlov, Ed Kemper, Nevada Tan, Jim Jones entre outros. Cada caso mais bizarro que o outro.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/jyvjudQDqsQ/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLAF0DX2vFscBf2IIlwNFPy-RCLv_Q","width":168,"height":94},{"url":"https://i.ytimg.com/vi/jyvjudQDqsQ/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLB3fUbFDT3tALrFAil-CJEcUTw5ng","width":196,"height":110},{"url":"https://i.ytimg.com/vi/jyvjudQDqsQ/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLDKyJvZpCXLXj8bn54myPAVNO9f1g","width":246,"height":138},{"url":"https://i.ytimg.com/vi/jyvjudQDqsQ/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLAq_eOBf-OIsrAWw0o38NWRUB3qpQ","width":336,"height":188},{"url":"https://i.ytimg.com/vi/jyvjudQDqsQ/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatin /creators/colecionador-de-ossos\n\n• Fontes e referências\nhttps://github.com/CarolinaRussi/Junko-Furuta\n\n• Contato comercial\ncontato@colecionadordeossos.com\n\n• Redes Sociais\nInstagram: https://www.instagram.com/bryan.emme/\nTwitter: https://twitter.com/cdossos\nTikTok: @bryan.emme\n\n_____________________________________\n\n• Créditos\nRoteiro | @alexanderbertoti\nRev. do texto | @carolinarussif\nDireção | @bryan.emme\nIlustrações | @carolinarussif\nAssistência de câmera | @tollledo\nEdição | @iago_russi\nPós produção | @bryan.emme\nImagens: Envato (Elements)\nTrilha sonora: EpidemicSound\n\n#casoscriminais #crimesreais #casos #crimes #truecrime\n\ncriminalisinvestigationecdossos\n\nColecionador de ossos é um canal de \"True Crime\" (que significa crimes reais). Apresentado por Bryan Emmendörfer, os vídeos contam casos criminais que ocorrem em todo o mundo, desde casos criminais norte americanos, brasileiros ou até mesmo de países pouco conhecidos. \n\nO mundo do True Crime já era muito desbravado por canais como Freak TV, Jaqueline Guerreiro, Ler até amanhecer entre outros. E nós chegamos para somar! Acreditamos que quanto mais canais falando sobre o mundo criminal, melhor é todos, pois o publico aumenta consequentemente.\n\nNossos vídeos abordam desaparecimentos, serial killers (assassinos em série). Nós produzimos os vídeos em um estilo documentário criminal (documentários criminais) como se fosse digamos assim, um documentário criminal dublado, algo importado de documentários internacionais de crimes reais.\n\nJá produzimos grandes casos aqui no canal, como Jeffrey Dahmer, Albert Fish, Richard Ramirez, Joe Metheny, Billy Milligan, Caso Araceli, Unabomber, Irmãos Bever, Passo Dyatlov, Ed Kemper, Nevada Tan, Jim Jones entre outros. Cada caso mais bizarro que o outro."},"lengthSeconds":"1137","ownerProfileUrl":"http://www.youtube.com/@OssosPerdidos","externalChannelId":"UCMarwbCbVZcog2FsjQJH-sw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG"," imes reais.\n\nJá produzimos grandes casos aqui no canal, como Jeffrey Dahmer, Albert Fish, Richard Ramirez, Joe Metheny, Billy Milligan, Caso Araceli, Unabomber, Irmãos Bever, Passo Dyatlov, Ed Kemper, Nevada Tan, Jim Jones entre outros. Cada caso mais bizarro que o outro.","commandRuns":[{"startIndex":30,"length":52,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLIDEM2rARgBIhMI--jLs5irjwMV3ni4BB2L5SzE","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=rpGMAeLvTS8\u0026list=PLcboUpV5Iv4m0771LmSuf5vRLzHgGUTJW\u0026index=1","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"rpGMAeLvTS8","playlistId":"PLcboUpV5Iv4m0771LmSuf5vRLzHgGUTJW","index":0,"startTimeSeconds":0,"loggingContext":{"vssLoggingContext":{"serializedContextData":"GiJQTGNib1VwVjVJdjRtMDc3MUxtU3VmNXZSTHpIZ0dVVEpX"}},"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-bboxu-j4js.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=ae918c01e2ef4d2f\u0026ip=200.201.116.190\u0026initcwndbps=1593750\u0026mt=1756304173\u0026oweuc=\u0026pxtags=Cg4KAnR4Egg1MTU2OTY2NA\u0026rxtags=Cg4KAnR4Egg1MTU2OTY2Mw%2CCg4KAnR4Egg1MTU2OTY2NA%2CCg4KAnR4Egg1MTU2OTY2NQ%2CCg4KAnR4Egg1MTU2OTY2Ng"}}}}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: A FAZENDA DE PORCOS DO SERlAL KlLLER ROBERT PICKTON"}}},{"startIndex":102,"length":21,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLIDEM2rARgBIhMI--jLs5irjwMV3ni4BB2L5SzE","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/channel/UCMarwbCbVZcog2FsjQJH-sw/join","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/channel/UCMarwbCbVZcog2FsjQJH-sw/join","nofollow":true}}},"onTapOptions":{"accessibilityInfo":{"accessibil
